Head
: Three distinct ocelli. The vertex cannot be recognized as a separate sclerite. Occiput with long, black hairs behind the ocelli. Antenna as shown in fig. 
7
: Pedicellus longer than scapus, stylus two segmented. Proboscis much longer than the head (fig. 
6
). Labellum hardly broader than the labrum with inconspicuous, short hairs (fig. 
6
). Palpus vestigial. Occiput and frons black-brown. Parafacial without black spot (fig. 
6
). Parafacial with a few long, light yellow hairs. Parafacial close to the antennal groove with a small, shiny area, which is contrasting with the adjacent dusted parts. Facial carina occupying approximately half the length of the antennal groove, in the ventral part the facial carina joins the antennal groove. Gena broad (fig. 
6
). Head without setae.

